import React from 'react';
import {FilterValuesType} from "./App";




type ButtonType = {
    name:FilterValuesType
    started:()=>void
    filtered?:()=>void
}


export const Button = (props:ButtonType) => {

    const  Started=()=> {
        props.started()
    }
    return (
        <div>
            <button onClick={Started}> {props.name}</button>

        </div>
    );
};
